import React, { useState } from "react";
import emailjs from "emailjs-com";
import logo from "./assets/logo.png";
import qr from "./assets/qr.png";
import successImage from "./assets/success.png";

function App() {
  const [formData, setFormData] = useState({
    name: "",
    occupation: "",
    email: "",
    whatsapp: "",
    datetime: "",
    topic: "",
  });
  const [submitted, setSubmitted] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Send confirmation to user
    emailjs
      .send(
        "service_ted5m2h",
        "template_5qmfosa",
        {
          name: formData.name,
          email: formData.email,
        },
        "D8Cr-U9g1MVqsc5bv"
      )
      .then(() => console.log("Confirmation sent"));

    // Alert admin
    emailjs
      .send(
        "service_ted5m2h",
        "template_nzvxr9o",
        {
          name: formData.name,
          email: formData.email,
        },
        "D8Cr-U9g1MVqsc5bv"
      )
      .then(() => console.log("Alert sent to admin"));

    setSubmitted(true);
  };

  return (
    <div className="bg-gray-100 font-sans">
      {/* Header with Nav */}
      <header className="flex justify-between items-center p-6 bg-white shadow-md">
        <div>
          <h1 className="text-2xl font-bold text-gray-800">SafeCircle</h1>
          <p className="text-sm text-gray-500">Feel heard. Feel safe.</p>
        </div>
        <nav className="space-x-4">
          <a href="#whatwedo" className="text-gray-700 hover:text-teal-500">What We Do</a>
          <a href="#trust" className="text-gray-700 hover:text-teal-500">Why Trust Us</a>
          <a href="#plans" className="text-gray-700 hover:text-teal-500">Plans</a>
          <a href="#booking" className="text-gray-700 hover:text-teal-500">Book</a>
          <a href="#faq" className="text-gray-700 hover:text-teal-500">FAQ</a>
          <a href="#contact" className="text-gray-700 hover:text-teal-500">Contact</a>
        </nav>
        <img src={logo} alt="Logo" className="w-16 h-16" />
      </header>

      {/* Hero */}
      <section className="text-center py-20 bg-teal-50">
        <h2 className="text-4xl font-bold mb-4">SafeCircle</h2>
        <p className="text-lg text-gray-600 mb-4">Calm conversations. Honest support.</p>
      </section>

      {/* What We Do */}
      <section id="whatwedo" className="px-6 py-10">
        <h3 className="text-2xl font-semibold mb-4">What We Do</h3>
        <ul className="list-disc list-inside text-gray-700 space-y-2">
          <li>Listen to anything on your mind — school, life, overthinking, or just silence.</li>
          <li>Make you feel lighter with calm, honest conversation.</li>
          <li>Give simple guidance or just a space to breathe — no pressure.</li>
        </ul>
      </section>

      {/* Why Trust Us */}
      <section id="trust" className="px-6 py-10 bg-white">
        <h3 className="text-2xl font-semibold mb-4">Why Trust Us?</h3>
        <ul className="list-disc list-inside text-gray-700 space-y-2">
          <li>100% privacy</li>
          <li>Compassionate listeners</li>
          <li>Real talk</li>
        </ul>
      </section>

      {/* Plans */}
      <section id="plans" className="px-6 py-10">
        <h3 className="text-2xl font-semibold mb-4">Our Plans</h3>
        <p className="text-gray-600">Starting at ₹49 per session. Customized options available.</p>
      </section>

      {/* Booking Form */}
      <section id="booking" className="px-6 py-10 bg-teal-50">
        <h3 className="text-2xl font-semibold mb-6">Book a Session</h3>
        <div className="grid md:grid-cols-2 gap-10 items-center">
          <form onSubmit={handleSubmit} className="space-y-4">
            <input name="name" onChange={handleChange} required placeholder="Your Name" className="w-full p-2 border rounded" />
            <input name="occupation" onChange={handleChange} required placeholder="Current Occupation" className="w-full p-2 border rounded" />
            <input name="email" onChange={handleChange} required placeholder="Email ID" type="email" className="w-full p-2 border rounded" />
            <input name="whatsapp" onChange={handleChange} required placeholder="WhatsApp Number" className="w-full p-2 border rounded" />
            <input name="datetime" onChange={handleChange} required placeholder="Preferred Date and Time" className="w-full p-2 border rounded" />
            <textarea name="topic" onChange={handleChange} required placeholder="Topic / What You Want to Talk About" className="w-full p-2 border rounded"></textarea>
            <input type="file" className="w-full" />
            <button type="submit" className="bg-teal-500 text-white px-4 py-2 rounded hover:bg-teal-600">Submit</button>
            <p className="text-sm text-gray-600 mt-2">Our team will contact you after payment confirmation within a few minutes to a few hours. Please be patient.</p>
          </form>
          <img src={qr} alt="QR Code" className="max-w-xs mx-auto" />
        </div>
      </section>

      {/* Testimonials */}
      <section className="px-6 py-10">
        <h3 className="text-2xl font-semibold mb-4">What Our Users Say</h3>
        <div className="space-y-4 text-gray-700">
          <p className="italic">"It felt like talking to someone who truly cared. Thank you."</p>
          <p className="italic">"No judgments. Just peace and honesty. I'm grateful."</p>
        </div>
      </section>

      {/* FAQ */}
